import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';

function App() {
  return (
    <div>
        <Router>
            <Routes>
                <Route path="/" element={
                    <Weather
                    />}/>
                <Route path="/" element={
                    <Favorites
                    />}/>
                <Route path="/" element={
                    <Popular
                    />}/>
            </Routes>
        </Router>
    </div>
  );
}

function Nav() {
    return (
        <ul id='nav'>
            <li><link to="/"/>Weather<link/></li>
            <li><link to="/favorites"/>Favorites<link/></li>
            <li><link to="/popular"/>Popular<link/></li>
        </ul>

    );
}

function Header() {
    return (
        <div className='App'>
            <h2>Weather App</h2>
            <Nav />
        </div>
    );
}

function Weather() {
    return (
        <div className="app-center">
            <Header />

        </div>
    )
}

function Favorites() {
    return (
        <div className="app-center">
            <Header />

        </div>
    )
}

function Popular() {
    return (
        <div className="app-center">
            <Header />

        </div>
    )
}


export default App;
